jQuery(function (a) {
  var t = {
    init: function () {
      a(document.body).on(
        "click dragstart",
        ".mhk-registered-item.upgrade-modal",
        this.field_upgrade
      ),
        a(document.body).on(
          "click dragstart",
          ".mhk-registered-item.enable-stripe-model",
          this.enable_stripe_model
        ),
        a(document.body).on(
          "click dragstart",
          ".muhiku-plug-field-option-row.upgrade-modal",
          this.feature_upgrade
        ),
        a(document.body).on(
          "click dragstart",
          ".mhk-upgradable-feature, .muhiku-plug-btn-group span.upgrade-modal",
          this.feature_upgrade
        );
    },
    feature_upgrade: function (e) {
      e.preventDefault(),
        t.upgrade_modal(
          a(this).data("feature") ? a(this).data("feature") : a(this).text()
        );
    },
    field_upgrade: function (e) {
      e.preventDefault(),
        t.upgrade_modal(
          a(this).data("feature")
            ? a(this).data("feature")
            : a(this).text() + " field"
        );
    },
    upgrade_modal: function (e) {
      var t = mhk_upgrade.upgrade_message.replace(/%name%/g, e);
      a.alert({
        title: e + " " + mhk_upgrade.upgrade_title,
        icon: "dashicons dashicons-lock",
        content: t,
        type: "red",
        boxWidth: "565px",
        buttons: {
          confirm: {
            text: mhk_upgrade.upgrade_button,
            btnClass: "btn-confirm",
            keys: ["enter"],
            action: function () {
              window.open(mhk_upgrade.upgrade_url, "_blank");
            },
          },
          cancel: { text: mhk_data.i18n_ok },
        },
      });
    },
    enable_stripe_model: function (e) {
      e.preventDefault(),
        a.alert({
          title: mhk_upgrade.enable_stripe_title,
          content: mhk_upgrade.enable_stripe_message,
          icon: "dashicons dashicons-info",
          type: "blue",
          buttons: {
            confirm: {
              text: mhk_data.i18n_close,
              btnClass: "btn-confirm",
              keys: ["enter"],
            },
          },
        });
    },
  };
  t.init();
});
